            label: 'Password'
        }) }}
        {{ form_row(registrationForm.tel) }}
        {{ form_row(registrationForm.img1) }}
        {{ form_row(registrationForm.adresse) }}
        {{ form_row(registrationForm.code_postal) }}
        {{ form_row(registrationForm.ville) }}
        {{ form_row(registrationForm.agreeTerms) }}

